import React, { Component } from "react";
import { Breadcrumb, Button } from "react-bootstrap"

class ConsultarListaVacunacion extends Component {

    componentDidMount() {

    }

    render() {
        return (
            <div>
                <Breadcrumb style={{ margin: 30 }}>
                    <Breadcrumb.Item href="/">SiGeVa</Breadcrumb.Item>
                    <Breadcrumb.Item href="/Sanitario/ConsultarListaVacunacion">Consultar Lista Vacunacion</Breadcrumb.Item>
                </Breadcrumb>
                <div style={{ marginBotton: 20 }}>
                    <h5>Estas en la página de Gestion de Usuarios</h5>
                </div>
                <div>
                    <p>Selecciona la acción que quieres realizar: </p>

                </div>
            </div>
        );
    }
}

export default ConsultarListaVacunacion
